import { Link } from "react-router-dom";

import home_button_pic from '../../assets/images/home_button_pic.JPG';

function Navbar() {
    return (
        <div>
            <div>
                <Link to="/Jacob-Lin">Home</Link>
            </div>
            <nav>
                <Link to="About">About</Link>
                <Link to="Links">Links</Link>
            </nav>
        </div>
    )
}

export default Navbar;
